Object.Field:
BEGIN
EXECUTE IMMEDIATE 'ALTER SESSION SET NLS_DATE_FORMAT = "YYYY-MM-DD HH24:MI:SS"';
MERGE INTO OPR_REQUEST_DTLS F_TAB USING ( SELECT * FROM STG_OPR_REQUEST_DTLS WHERE (REQ_NUMBER,LAST_UPDATED) IN (SELECT REQ_NUMBER,MAX(LAST_UPDATED) FROM STG_OPR_REQUEST_DTLS GROUP BY REQ_NUMBER) ) STG_TAB ON (F_TAB.REQ_NUMBER = STG_TAB.REQ_NUMBER) WHEN MATCHED THEN UPDATE SET F_TAB.PRIORITY = STG_TAB.PRIORITY, F_TAB.CREATED = TO_DATE(TRIM(STG_TAB.CREATED)), F_TAB.CREATED_DT = TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), F_TAB.STATE = STG_TAB.STATE, F_TAB.ASSIGNED_TO = STG_TAB.ASSIGNED_TO, F_TAB.ASSIGNMENT_GROUP = STG_TAB.ASSIGNMENT_GROUP, F_TAB.TASK_TYPE = STG_TAB.TASK_TYPE, F_TAB.CI = STG_TAB.CI, F_TAB.SHORT_DESCRIPTION = STG_TAB.SHORT_DESCRIPTION, F_TAB.LAST_UPDATED = TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), F_TAB.CLOSED = TO_DATE(TRIM(STG_TAB.CLOSED)), F_TAB.SLA_DUE = TO_DATE(TRIM(STG_TAB.SLA_DUE)) WHERE TO_DATE(TRIM(STG_TAB.LAST_UPDATED)) > F_TAB.LAST_UPDATED WHEN NOT MATCHED THEN INSERT ( F_TAB.REQ_NUMBER, F_TAB.PRIORITY, F_TAB.CREATED, F_TAB.CREATED_DT, F_TAB.STATE, F_TAB.ASSIGNED_TO, F_TAB.ASSIGNMENT_GROUP, F_TAB.TASK_TYPE, F_TAB.CI, F_TAB.SHORT_DESCRIPTION, F_TAB.LAST_UPDATED, F_TAB.CLOSED, F_TAB.SLA_DUE ) VALUES ( STG_TAB.REQ_NUMBER, STG_TAB.PRIORITY, TO_DATE(TRIM(STG_TAB.CREATED)), TO_DATE(SUBSTR(TRIM(STG_TAB.CREATED_DT),0,10)), STG_TAB.STATE, STG_TAB.ASSIGNED_TO, STG_TAB.ASSIGNMENT_GROUP, STG_TAB.TASK_TYPE, STG_TAB.CI, STG_TAB.SHORT_DESCRIPTION, TO_DATE(TRIM(STG_TAB.LAST_UPDATED)), TO_DATE(TRIM(STG_TAB.CLOSED)), TO_DATE(TRIM(STG_TAB.SLA_DUE)) ); END;
